import React, { useEffect } from 'react';
import Chatting from '../../components/Chatting/Chatting';

const ChattingContainer = () => {
  useEffect(() => {
    return () => {
      if (localStorage.other) {
        localStorage.removeItem('other');
      }
    };
  });
  return <Chatting />;
};

export default ChattingContainer;
